css:
.deprecation-cop-status .icon.icon-alert:before {
  width: 17px;
}
.deprecation-cop {
  overflow: auto;
  -webkit-flex: 1;
  background-color: #2c3e50 !important;
}
.deprecation-cop .deprecation-info {
  padding: 0 10px;
}
.deprecation-cop .deprecation-info:hover {
  background-color: #7f8c8d !important;
}
.deprecation-cop .collapsed > ul {
  display: none;
}
.deprecation-cop .list {
  list-style-type: none;
  padding: 0;
}
.deprecation-cop .stack-trace {
  background-color: #34495e;
  padding: 10px;
  margin-bottom: 10px;
}
.deprecation-cop a {
  color: #ecf0f1;
}
